import * as React from 'react';
import style from './index.module.scss';
export default function Home () {
  return (
    <div className={style.banner}>
       <div className='container'>
        <h1>Hello, <br/> I am  <span>Jitendra</span></h1>
       </div>
    </div>
  );
}
